import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'
import { HomePage, CounterButtonPage, PeopleListPage } from './pages'
function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/" exact>
          <HomePage />
        </Route>
        <Route path="/counter" exact>
          <CounterButtonPage />
        </Route>
        <Route path="/people-list" exact>
          <PeopleListPage />
        </Route>
      </Router>
    </div>
  );
}

export default App;
